MANUAL DO PATRIOTA

1. Partidos políticos nunca estiveram pelo povo e nunca estarão. Eles fazem pra si mesmos; 

2. Tudo o que vem de partidos é bom para eles se manterem na velha ordem, ou no máximo, menos pior;  

3. A nossa luta é INT€RV€NÇÃO MI£ITAR full nos poderes corrompidos. Depois elegeremos o nosso presidente oficialmente e os nossos parlamentares de direita no voto de papel, e instituiremos um novo SUPREMO, com onze juízes de verdade;

4. Cuidado com os trios elétricos. Eles vêm de partidos políticos. O Agro está conosco, mas lembre-se: por trás do Agro também tem partido político. Arrecadar assinaturas, proibir faixas de INT€RV€NÇÃO, forçar o povo e/ou o Presidente no art. 142 (apenas garantia da lei e da ordem), anular eleições, pedir impeachment de cabeças isoladas, pressionar parlamentares, etc., são ações de manutenção da velha política;

5. A PRIMAVERA BRASILEIRA QUER TUDO NOVO;

6. Não vamos sair das Portas dos Qu@rtéis.

7. O nosso problema não é apenas o PT e a fraude. É todo o sistema.
